INSERT INTO `pro_news` (`pid`, `title`, `url`, `metatitle`, `metakey`, `metadesc`, `image`, `body`, `priority`, `createTime`, `status`) VALUES
(4, 'India lost its Top ODI Rank', 'india-lost-its-top-odi-rank', 'India vs New Zealand Live Cricket Update - India tour of New Zealand 2014', 'India vs New Zealand, Live Cricket news, India tour of New Zealand 2014, India losing top ODI rank, india, New Zealand', 'India vs New Zealand Live Cricket Update - India tour of New Zealand 2014. India losing top ODI rank with 0-2 against New Zealand', '11823064471688193149.jpg', '<p>\r\n	India slipped its ODI rank battling against New Zealand in 2nd ODI which was played on 22nd January, 2014. <strong>India tour of New Zealand 2014</strong> begun from 19<sup>th</sup> January 2014 as per the cricket schedule announced by the Indian Cricket Broad. The series of India and New Zealand will be called as International Bilateral Series, India tour of New Zealand 2014 series is a part of FTP (Future Cricket Tour programs) prepared by ICC (International Cricket Council). India tour of New Zealand 2014 series will play in New Zealand in which 5 ODI and 2 test matches will be played between India and New Zealand from 19<sup>th</sup> January 2014 to 18<sup>th</sup> February 2014.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>India vs New Zealand</strong> 1<sup>st</sup> ODI will be played on Sunday 19<sup>th</sup> January 2014 at Mclean Park in Napier. All the 5 ODI of India vs. New Zealand will be played day/night starting at Local GMT 01:00 hrs. Local New Zealand time 14:00 hrs. and Indian time 06:30. The 2<sup>nd</sup> and the 4<sup>th</sup> ODI matches of <strong>New Zealand vs. India 2014 series</strong> will be played in Hamilton on 22<sup>nd</sup> January and 28<sup>th</sup> January 2014, whereas the 3<sup>rd</sup> one day International cricket match between <strong>India vs. New Zealand</strong> will be played on 25<sup>th</sup> January 2014 in Auckland followed by the 5<sup>th</sup> and last ODI of India vs. New Zealand series will be played on 31<sup>st</sup> January 2014 in Wellington. India vs. New Zealand 2014 test series will play on 6<sup>th</sup> February 2014 in Auckland and the second test match India vs. New Zealand will play on 14<sup>th</sup> February 2014 in Wellington.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Keep checking for Complete Cricket News, Score, Video and Schedule of <a href=\\"http://cricket.watchcriclive.com/india-tour-of-new-zealand-live-streaming/26\\" title=\\"india tour of new zealand\\">India Tour of New Zealand 2014</a> Series</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n', '0.64', '2014-01-23 09:38:02', 'Active'),
(5, 'India vs New Zealand 2014', 'india-vs-new-zealand-series-2014-live-cricket-telecast-on-tv-free', 'India vs New Zealand Series 2014 Live Cricket Telecast on TV Free', 'Live Cricket, India vs New Zealand, Series 2014, Telecast on TV, Free, India vs New Zealand 2014', 'India vs New Zealand Series 2014 Live Cricket Telecast on TV Free Broadcast on Internet and on Mobile devices Online on Star Sports HD and Sky Sports. Live Score, Schedule, Fixtures 2014', '14576008021863510183.gif', '<p>\r\n	<strong>Live cricket</strong> match between <strong>India vs New Zealand 2014</strong> series will be telecast on Sony Six, Indian official broadcaster DD national and Star Cricket, whereas in New Zealand all the <strong>New Zealand vs India</strong> live cricket match can be watched on Sky Sports.</p>\r\n<p>\r\n	Below is the list of TV channels which broadcast the live cricket matches played between <strong>India</strong> and <strong>New Zealand</strong> for <a href=\\"http://cricket.watchcriclive.com/india-tour-of-new-zealand-live-streaming/26\\" title=\\"india tour of new zealand\\">India tour of New Zealand</a> 2014, countries wise:</p>\r\n<p>\r\n	<br />\r\n	Australia &ndash; <strong>Fox Sports</strong><br />\r\n	Canada &ndash; <strong>Cricket Plus</strong> and CBN<br />\r\n	Caribbean &ndash; <strong>Sports Max</strong><br />\r\n	Middle East &ndash; <strong>Orbit Show Network</strong><br />\r\n	Pakistan &ndash; <strong>PTV Sports</strong><br />\r\n	UAE &ndash; <strong>OSN Network</strong><br />\r\n	USA &ndash; <strong>Willow TV</strong> and Direct TV<br />\r\n	India &ndash; <strong>Star Sports</strong><br />\r\n	United Kingdom &ndash; <strong>Sky Sports 2</strong></p>\r\n<p>\r\n	<br />\r\n	According to media it was not an easy to Sony Six to bag the India vs New Zealand 2014 series right, but still the management of Sony Six managed to secure the exclusive rights of broadcasting India tour of New Zealand 2014 complete series including ODI and test matches. Sony Six is the official broadcast channel of Indian Premier League right from its inception 2008 and also secured the right to broadcast Indian Premier League (IPL) 2014 continue till 2017. Sony Six will be broadcasting all the Live and Exclusive India vs New Zealand cricket match and upcoming Indian Premier League Series 2014. All the supporter of Indian cricket team is very much eager about the India tour of New Zealand series 2014 after the defeat of India vs. South Africa series in 2013.</p>\r\n<p>\r\n	<br />\r\n	<strong>Live cricket streaming</strong> of <strong>India vs New Zealand ODI</strong> and Test matches will be show on the official website of Star Sports i.e. www.starsports.com for those cricket fans who can&rsquo;t able to watch the live cricket match on the television due to busy schedule. Here is the opportunity to watch live India vs. New Zealand 1st ODI and all other cricket and football matches live &amp; exclusive.<br />\r\n	&nbsp;</p>\r\n', '0.64', '2014-01-26 05:50:09', 'Active'),
(6, 'Star Sports HD Channel', 'star-sports-live-streaming-watch-star-sports-hd-star-cricket-live-football', 'Star Sports Live Streaming Watch Star Sports HD Star Cricket Live Football', 'Star cricket, Live cricket, Star Sports Live Streaming, Star Sports HD, ESPN, Cricket, Football, Tennis, NBA, Star Sports Live Telecast, Star Sports, Star Sports 1, Free on Internet', 'Star Sports Live Streaming Watch Star Sports HD Star Cricket Live Football. Watch Cricket, Football, Tennis, NBA and many other Sports Live Telecast Online. Star Sports Live Telecast Free on Internet', '1070598201658624274.png', '<p>\r\n	<strong>Star Sports</strong>, formerly generally known as Prime Sports, is any cable multilevel for featuring sports-programmes, held by STAR TV and also Fox Overseas Channels. <strong>Star Sports live telecast</strong> will be available in Asia, India, Pakistan, Bangladesh, Thailand, Malaysia, Singapore, Philippines, Philippines, Vietnam, Hong Kong, and other Asian territories. Star Sports live streaming is also available in HD channels telecasted on TV and also broadcasted on internet on star sports website which will showcase all star network series and sports like <a href="http://cricket.watchcriclive.com" title="live cricket"><strong>live cricket</strong></a>, soccer, <a href="http://football.watchcriclive.com" title="live football"><strong>live football</strong></a>, nba, tennis, hockey, etc.\r\n<br />\r\n<strong>Star Sports Live Streaming</strong> will telecast on TV and also broadcast over internet all the major cricket and football tournaments on their websites starsports.com in very good quality and also with a convenient timeline of each segment of the game. Remember, <strong>Star cricket live streaming</strong> is now <em>Star sports live streaming</em>.</p>\r\n	<br />\r\n<p>\r\n	STAR Sports India re-branded and also unified it&#39;s channels with a whole new logo which arrived into effect from 5th of November 2013 onwards. By effect of the rebranding physical exercise STAR Sporting activities became Star Sports 1, <strong>Star Cricket</strong> in order to STAR Sporting activities 3, ESPN Asia to Star Sports some, STAR Cricket HD to Star Sports 1 HD, and ESPN HD to Star Sports only two HD<br />\r\n	<br />\r\n	STAR sports activities group planned to develop a national sports multilevel network in India. The plan includes broadcasting in Indian dialects. Starting through Hindi, which is usually spoken by a major amount of population and Southern region of Indian dialects. ESPN ended up being renamed Star Sports 4, Star Cricket ended up being renamed <strong>Star Sports 3</strong>, Star Sports ended up being renamed Star Sports 1 and also STAR Sports 2 held its identify. Star Cricket HD and ESPN HD will likely be renamed to <strong>Star Sports 1 HD</strong> and Star Sports 2 HD respectively. STAR SPORTS 3 will likely be predominantly in Hindi-only language for the Hindi speaking cricket fans. Only Star Sports 2 and <strong>Star Sports 4</strong> are dedicted to telecast Cricket sports and whereas others i.e. Star Sports 1 and Star Sports 3 will be broadcasting different sports, like football, soccer, NFL, NBA, etc.<br />\r\n	<br />\r\n	<strong>Watch Live Star Sports</strong> network will be the official broadcast station for your favorite <strong>Cricket</strong>, <strong>Football</strong>, <strong>Barclays Premier League</strong>, <strong>FA Cup</strong>, <strong>La Liga</strong>, <strong>Australian Open</strong>, <strong>Tennis</strong>, <strong>NBA</strong>, etc.</p>\r\n', '0.64', '2014-01-26 07:48:13', 'Active'),
(7, 'India vs New Zealand Test', 'india-vs-new-zealand-live-streaming-test-cricket-matches-06-14-feb', 'India vs New Zealand Live Streaming Test Cricket Matches 06 - 14 Feb', 'Live, India vs New Zealand Live Streaming, Test Cricket Matches, 06 - 14 Feb, Live Cricket Streaming,IND vs NZ, Live Cricket Telecast', 'Live India vs New Zealand Live Streaming Test Cricket Matches 06 - 14 Feb. Live Cricket Streaming of IND vs NZ Live Cricket Telecast from 6th - 14th February', '2045755560619988909.jpg', '<p>\r\n	<strong>India Tour of New Zealand 2014</strong>: <a href=\\"http://cricket.watchcriclive.com/india-tour-of-new-zealand-live-streaming/26\\" title=\\"india vs new zealand live\\"><strong>India vs New Zealand Live Streaming</strong></a> of 2 test matches will begin from 6th February 2014. The series has started from 19th January 2014 as per the cricket schedule announced by the Indian Cricket Broad. The series of India and New Zealand will be called as International Bilateral Series, India tour of New Zealand 2014 series is a part of FTP (Future Cricket Tour programs) prepared by ICC (International Cricket Council).</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	India tour of New Zealand 2014 series will play in New Zealand in which 5 ODI and 2 test matches will be played between India and New Zealand from 19th January 2014 to 18th February 2014. India vs New Zealand 1st ODI will be played on Sunday 19th January 2014 at Mclean Park in Napier. All the 5 ODI of India vs New Zealand will be played day/night starting at Local GMT 01:00 hrs.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Local New Zealand time 14:00 hrs. and Indian time 06:30. The 2nd and the 4th ODI matches of <strong>New Zealand vs India</strong> 2014 series will be played in Hamilton on 22nd January and 28th January 2014, whereas the 3rd one day International cricket match between India vs. New Zealand will be played on 25th January 2014 in Auckland followed by the 5th and last ODI of India vs.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	New Zealand series will be played on 31st January 2014 in Wellington. India vs. New Zealand 2014 test series will play on 6th February 2014 in Auckland and the second test match India vs New Zealand will play on 14th February 2014 in Wellington.<br />\r\n	<br />\r\n	Click for Complete Cricket News, Score, Video and Schedule of <strong>IND vs NZ Live Cricket</strong> Series.<br />\r\n	&nbsp;</p>\r\n', '0.64', '2014-01-30 06:57:18', 'Active'),
