, '2', '2014', '0.80', 'Active'),
(32, 'World Cup 2015', '1250870711166199805.jpg', 'world-cup-2015-live-streaming', 'Australia', '<p>\r\n	<strong>World Cup 2015</strong> will be the 11th <strong>Cricket World Cup</strong>, and this global tournament will be jointly organized and hosted by New Zealand and <span>Australia</span> and is scheduled to kick start from <span class=\\"dtstart\\">14 Feb 2015</span> to 29 Mar 2015. A total of 49 games will be played at 14 different venue. out of 49 games, 26 will be played in Australia (Brisbane, Adelaide, Hobart, Canberra, Perth, Melbourne and Sydney) and the remaining 23 games will be held in New Zealand in different cities (Christchurch, Auckland,&nbsp; Hamilton, Dunedin, Nelson, Napier and Wellington) as per cricket <strong>world cup 2015 schedule</strong> announced by ICC.<br />\r\n	<br />\r\n	The opening match of the <strong>ICC World Cup 2015</strong> will be held at Christchurch in New Zealand. Sri Lanka and New Zealand will play the very first match of the ICC World Cup 2015 tournament on 14 Feb 2015, and the final match of the ICC World Cup 2015 tournament will take place at Melbourne ground on 29 Mar 2015.<br />\r\n	<br />\r\n	<strong>World Cup Live Streaming</strong> will feature 14 teams, divided into 2 groups of 7 teams Pool A - (England, New Zealand, Australia, Bangladesh, Sri Lanka, Qualifier 2 and 3) and Pool B - (India, South Africa, Pakistan, Ireland, West Indies, Zimbabwe and Qualifier 4). Hosts Australia and New Zealand are in Pool A and Current Champions India and 1992 World Cup winner Pakistan are in Pool B. ICC World Cup 2015 ensures each team from Pool A and Pool B to play 6 matches even if they exit.<br />\r\n	<br />\r\n	Defending Champions and Indian Cricket team captain MS Dhone won the 2011 ICC World Cup against Sri Lanka on 2nd April 2011. Former cricket players like Kapil Dev, Waqar Younis, Sanath Jayasuriya, Stephen Fleming, Ian Chappell and others.<br />\r\n	<br />\r\n	<strong>World Cup Champions</strong>:<br />\r\n	India (2011), Australia (2007), Australia (2003), Australia (1999), Sri Lanka (1996), Pakistan (1992), Australia (1987), India (1983), West Indies (1979), West Indies (1975)</p>\r\n', 'World Cup 2015 Watch Live Cricket Streaming ICC World Cup 2015', 'World Cup 2015, Watch, Live Cricket Streaming, ICC World Cup 2015, world cup, cricket world cup', 'World Cup 2015 Watch Live Cricket Streaming ICC World Cup 2015 Online Free on Internet being Telecasted by Star Cricket Sports HD ESPN and Sky Sports', '2015-02-14', '14', '2', '2015', '2015-03-29', '29', '3', '2015', '0.80', 'Active'),
